      <div style={{ display: "flex", flexWrap: "wrap" }}>
        <img
          src="https://idreamcareer.com/wp-content/uploads/2021/08/career-counselling-for-students.webp"
          height="400px"
          width="400px"
          alt=""
        />
      </div>
    </div>
  );
}

export default TenthSection;
